('En los planes de tarea que cree, agregue la tarea acordada para el pañol antes de que se vaya el equipo. La cual tiene que ir antes de la tarea pintura. Intente borrando todas las tareas y agregándolas todas de nuevo, borrando solo pintura y agregando primero la de verificación de materiales y dsp la de pinturo y lo haga como lo haga siempre queda en el orden\r\npintura\r\nverificación de materiales', '', '2', 14, '2014-01-27 15:55:05', '2014-01-27 15:55:05', '2014-01-29 09:46:35'),
('NECESITO QUE TODOS LOS USUARIOS DE TECNICA PUEDAN MODIFICAR LOS PEDIDOS DE MATERIALES', '', '2', 15, '2014-01-28 09:19:23', '2014-01-28 09:19:23', '2014-01-29 09:46:50'),
('', 'Cuando el sector técnica agrega las tareas que deben realizarse, debería agregarse un campo para determinar a que sector le corresponde dicha tarea para que solo ese sector pueda darle la finalización a esa tarea.', '2', 16, '2014-01-28 09:40:03', '2014-01-28 09:40:03', NULL),
('En la O/T  J-408 T. Las tareas cuando yo las armo en el plan de tareas las pongo en el orden en que quiero que se realicen METALIZAR - MAQUINADO - ANÁLISIS DIMEN. FINAL. Y me los ordena por como fueron agregadas las tareas Análisis dimensional final - Maquinado - Metalizar ', '', '24', 17, '2014-01-28 15:03:37', '2014-01-28 15:03:37', '2014-01-29 09:47:06'),
('Otra vez me vuelve a pasar lo mismo que con Alcira con la O/T N°3. Que ella agrego tareas y desaparecieron, cuando las volvió a cargar de nuevo paso que en el informe de requerimientos que se le envía al cliente le aparecieron todas las tareas de nuevo. \r\nAhora Ruben cargo hoy a la mañana todas las tareas asignadas a la O/T 9 y resulta ser que ahora desaparecieron! y la tarea ni siquiera esta concluida. Hace que aparezcan por favor ya que el personal del taller no puede continuar sin eso. Gracias', '', '2', 18, '2014-01-28 15:37:56', '2014-01-28 15:37:56', '2014-01-29 09:47:18'),
('ot n°15 primeramente se cargo  el cliente como dock sud y es la matanza.\r\ncuando hago el requerimiento me aparece que el cliente sigue siendo dock sud', '', '35', 19, '2014-01-29 12:45:28', '2014-01-29 12:45:28', '2014-02-10 12:58:03'),
('en la ot n|15 cuando se envio no se ve los materiales pedidos', '', '35', 20, '2014-01-29 12:49:38', '2014-01-29 12:49:38', NULL),
('La OT N° 4, ya se fue de Coopertei y recien terminamos de concluir todos los materiales y no se va, sigue quedando ahi, no se va al historial.', '', '42', 21, '2014-01-29 14:17:38', '2014-01-29 14:17:38', '2014-02-10 12:42:21'),
('En la O/T 6, en el pedido de materiales, estoy intentando modificar los espárragos que son de Inoxidable de 7/16" x 6". y me tira error.', '', '2', 22, '2014-01-29 15:57:33', '2014-01-29 15:57:33', '2014-02-10 12:58:37'),
('REVISAR CREACION PLAN DE TAREAS', '', '1', 23, '2014-01-30 09:09:11', '2014-01-30 09:09:11', NULL),
('modificar datos del pedido de material para el cliente (no coopertei)', '', '1', 24, '2014-01-30 09:21:05', '2014-01-30 09:21:05', '2014-02-10 12:46:16'),
('cuando se concluye la ot los materiales pasan al historial', '', '1', 25, '2014-01-30 09:26:31', '2014-01-30 09:26:31', NULL),
('datos del pedido de material tiene que tener scroll', '', '1', 26, '2014-01-30 09:29:43', '2014-01-30 09:29:43', NULL),
('No puedo modificar la descripcion del material por ejemplo: En esparragos no puedo modificar inoxidable 7/16 "', '', '38', 27, '2014-01-30 10:30:40', '2014-01-30 10:30:40', '2014-02-10 12:33:49'),
('En la solapa materiales. realice un pedido para la ot 27. en un primer pedido puse rodamientos, arandela de rodamiento y tuerca de rodamiento y no se mostraba lo puesto. Por este motivo volvi a realizar el pedido. colocando nuevamente estos materiales. rodamientos, arandela y tuerca. en este segundo pedido salio todo bien. pero cuando voy a la solapa clientes/materiales me aparecen dos veces el mismo pedido.', '', '3', 28, '2014-02-03 08:03:56', '2014-02-03 08:03:56', '2014-02-10 12:59:04'),
('En la O/T 7, en el pedido de materiales pedi un eje y no aparece. Si voy al informe de requerimientos si se ve! Lo mismo que le pasaba a ruben...', '', '2', 29, '2014-02-03 15:12:01', '2014-02-03 15:12:01', '2014-02-10 13:00:28'),
('Cree un material, (umbraco), y no apareció, actualice F5, entre y salí, entre con otro usuario y seguía sin aparecer. Lo cree de nuevo y ahí me apareció 2 veces.', '', '2', 30, '2014-02-03 15:17:47', '2014-02-03 15:17:47', '2014-02-10 12:46:51'),
('Perdón, en la que puse eje, era caño el material que no se ve!!  O/T 7', '', '2', 31, '2014-02-03 15:20:03', '2014-02-03 15:20:03', '2014-02-10 12:46:56'),
('soy cristino, serrano nicolas y mansilla jonatan trabajaron  8 hs cada uno', '', '44', 32, '2014-02-05 07:27:08', '2014-02-05 07:27:08', '2014-02-10 12:33:57'),
('En la OT n°42 luego de enviado el pedido al cliente, en el pdf salieron las tareas desordenadas, por ej figura primero al analisis dimensional final antes de la construccion de anillos, lo mismo con el resto de las tareas', '', '37', 33, '2014-02-10 10:12:47', '2014-02-10 10:12:47', NULL),
('OT 41 : Ingreso una nueva tarea : Sello : reparar y con el numero 6 no aparece en la orden de trabajo.\r\nYa lo agregue dos veces y sigue sin aparecer.', '', '38', 34, '2014-02-10 12:43:40', '2014-02-10 12:43:40', '2014-02-10 13:02:17'),
('En el analisis dimensional no aparece ni las horas de trabajo ni los instrumentos que cargue.', '', '38', 35, '2014-02-10 12:45:02', '2014-02-10 12:45:02', '2014-02-10 13:06:54'),
('en la ot 41 no aparece en el analisis dimensional las cosas que cargue . Ni el tiempo que tarde ni los instrumentos.', '', '38', 36, '2014-02-10 12:56:25', '2014-02-10 12:56:25', '2014-02-10 13:05:02'),
('DARLE PERMISOS AL ADMIN PARA HACER TODAS LAS TAREAS PT', '', '1', 37, '2014-02-10 13:08:19', '2014-02-10 13:08:19', NULL),
('En la O/T N°8 Ruben agrego tareas el 28/01 y ahora revisando me doy cuenta que no estan, pero él mando desde clientes --->>Informe de requerimientos, el PDF y salió todo, ahora no hay nada.', '', '2', 38, '2014-02-10 15:03:26', '2014-02-10 15:03:26', NULL),
('En la O/T 42 Mariana cargo el sello, le dio F5 y no apareció, despues lo cargo de nuevo y apareció. Ahora yo (Majo) revisando todos veo que el sello aparece dos veces.', '', '2', 39, '2014-02-10 15:22:53', '2014-02-10 15:22:53', NULL),
('AGREGAR FECHA COMPLETA  A CADA PERSONA QUE COMPLETO UNA TAREA (created_at)', '', '2', 40, '2014-02-11 09:00:05', '2014-02-11 09:00:05', NULL),
('VER ELIIMINAR PEDIDO DE MATERIALES (#/materials) DATOS DEL PEDIDO DE MATERIAL\r\n', '', '2', 41, '2014-02-11 09:02:22', '2014-02-11 09:02:22', NULL),
('Cuando actualizo la O/T se me reinicia la tarea y se me borra todo', '', '2', 42, '2014-02-11 13:05:27', '2014-02-11 13:05:27', NULL),
('Se sugiere una mejora en la opcion crear pedido. cuando creamos un pedido empezamos a seleccionar los materiales que vamos a nececitar para la reparacion del equipo. cuando abre la ventana seleccionamos un material cualquiera y luego ponemos el material y despues la cantidad. para finalizar este pedido ponemos AGREGAR OTRO MATERIAL y asi seguimos con el pedido de otro material. el problema que estamos teniendo es que cuando pedimos 20 materiales para la reparacion de un equipo y surge un error inesperado tenemos que cargar toooodos los materiales nuevamente. esto hace que perdamos muchisimo tiempo en el llenado de todas las celdas. esto a su vez trae la posibilidad de tener mayores errores en el llenado. ', 'cuando apretamos el boton agregar material, tendria que haber un boton que guarde los materiales ya cargados.-', '3', 43, '2014-02-12 10:20:18', '2014-02-12 10:20:18', NULL),
('En la OT 26 Las tareas agregadas tienen el numero 3 es decir que quiero que sean paralelas y no puedo seguir con la tarea de las directrices. ', '', '2', 44, '2014-02-12 10:54:44', '2014-02-12 10:54:44', NULL),
('En la OT 45 la secuencia de todas las tareas se repite 5 veces', '', '2', 45, '2014-02-14 09:45:04', '2014-02-14 09:45:04', '2014-02-17 09:07:00'),
('En la OT 55 una vez completada la tarea analisis dimensional inicial no aparecen las horas q tarde ni los instrumentos utilizados.', '', '38', 46, '2014-02-14 12:02:57', '2014-02-14 12:02:57', NULL),
('En la OT 55 una vez terminado el informe de requerimeinto de tareas y de materiales lo envie y cuando lo quize abrir no pude abrirlo . Tambien vi que pesaba  48 K  y me parece muy poco. ', '', '38', 47, '2014-02-14 14:33:12', '2014-02-14 14:33:12', NULL),
('La o/t 13, cuando le doy ok al kit de vàlvulas como se reutilizò no cargo personas, y me aparecen personas ue yo no puse.', '', '45', 48, '2014-02-14 14:45:07', '2014-02-14 14:45:07', NULL),
('La OT 59 y la OT 61 tienen asignadas un plan de tareas y no aparece, recien agregue la OT 62 y le asigne un p?an de tareas y si lo cargo.-', '', '2', 49, '2014-02-17 10:28:24', '2014-02-17 10:28:24', NULL),
('En la OT 62 en el pdf salen las tareas desordenadas, ej analisis dimensional final antes de construccion de anillos en impulsor', '', '37', 50, '2014-02-18 09:38:41', '2014-02-18 09:38:41', NULL),
('En la OT 44 cargue el análisis dimensional y no aparecía mi nombre con las instrumentos . Entonces tilde para eliminar el control dimensional que había hecho y lo volví a cargar , me paso lo mismo y lo hice cuatro veces en la ultima vez que lo hice me aparecieron todos los otros que había hecho . Me quedo cuatro veces cargado.', '', '38', 51, '2014-02-19 10:02:56', '2014-02-19 10:02:56', NULL),
('Cuando se reciben materiales en el pañol no aparecen novedades avisando que se recibió algo', '', '2', 52, '2014-02-19 10:24:39', '2014-02-19 10:24:39', NULL),
('En la OT 62 cargue horas a rmado de equipo, rodamientos, prueba hidraulica, balanceo y pintura y las horas aparecieron todas desparramadas en cualquier tareas', '', '30', 53, '2014-02-22 15:41:32', '2014-02-22 15:41:32', NULL),
('tuve que cargar nuevamente el analisis dimensional de la OT 72  ya que no habia puesto el tiempo de realizacion del analisis dimensional , y una vez que lo cargue de nuevo me apareceron 3 veces mas el analisis dimensional', '', '38', 54, '2014-02-24 14:50:46', '2014-02-24 14:50:46', NULL),
('estaba cargando las tareas de la ot 77 para la reparacion del equipo y salio un error, actualice la pagina y desaparecio el nombre del equipo y lo que estaba cargando.', '', '3', 55, '2014-02-25 12:53:52', '2014-02-25 12:53:52', NULL),
('En la OT 77, faltaba la OT, Ruben ya había cargado tareas y cuando agregue la OT volvió a desaparecer todo lo que él ya había cargado.', '', '30', 56, '2014-02-25 12:55:43', '2014-02-25 12:55:43', NULL),
('alguien que le de bola a los reportes por favor... vamos a darle un fin a este programa porque estamos perdiendo el tiempo todos... hay veces que creo un pedido y cargo toooooooooooodos los materiales para un equipo y cuando llego abajo de todo no me aparece el boton generar pedido. y tengo que volver a cargar tooooooodoo nuevamente. ', 'terminar de una vez', '3', 57, '2014-02-25 13:37:38', '2014-02-25 13:37:38', NULL),
('Alguien le esta dando bola a los errores que enviamos???? porque siguen apareciendo los mismos errores que ya hemos reportado antes y que supuestamentente ya estaban solucionados. ', '', '2', 58, '2014-02-26 08:48:51', '2014-02-26 08:48:51', NULL),
('Necesito cambiar el nombre del equipo. Pero si lo hago se borran las tareas agregadas y tambien se borran las que ya estan concluidas', '', '2', 59, '2014-02-26 08:51:32', '2014-02-26 08:51:32', NULL),
('Es muy incomodo estar buscando entre todo el personal, siendo que esta la gente de planta también incluida.  ', 'Se puede hacer un filtro?? Que los supervisores de maquinado vean solo la gente de maquinado, los de mecánica solo los mecánicos y la parte tecnica solo los de calidad??', '2', 60, '2014-02-26 10:03:51', '2014-02-26 10:03:51', NULL),
('la ot 76 creo el pdf con las celdas desplazadas. ver pdf creado y observar la hoja numero 2 en la parte inferior.', '', '3', 61, '2014-02-26 11:07:34', '2014-02-26 11:07:34', NULL),
('estaría bueno que alguien de señales de vida del otro lado!!!', '', '2', 62, '2014-02-27 11:44:54', '2014-02-27 11:44:54', NULL),
('La O/T 84 generar un pdf con error que no se puede abrir. ', '', '76', 63, '2014-02-28 08:40:43', '2014-02-28 08:40:43', NULL),
('LA O/T 91 envió archivo PDF que no se puede abrir', '', '76', 64, '2014-02-28 15:40:02', '2014-02-28 15:40:02', NULL),
('NO PUEDO ASIGNAR PLAN DE TAREAS A NINGUN EQUIPO NI MODIFICAR NINGUN DATO.', '', '2', 65, '2014-03-05 15:24:01', '2014-03-05 15:24:01', NULL),
('no puedo completar la tarea de control dimensional del equipo J-60843 M OT:168\r\nUse los instrumentos cu48, mi3p04, miv04,\r\nsi no completo dicha tarea no puedo continuar.-', '', '3', 66, '2014-04-05 10:51:51', '2014-04-05 10:51:51', NULL),
('Necesito en la nómina de clientes, que aparezca la ciudad Mar del Plata.-', '', '2', 67, '2014-05-30 13:59:06', '2014-05-30 13:59:06', NULL),
('Necesito que las OT aparezcan ordenadas de la mas reciente a la mas antigua. Ya te lo había pedido Marce te lo recuerdo nomas', '', '2', 68, '2014-05-30 14:52:59', '2014-05-30 14:52:59', NULL);
